import * as React from 'react';
import {Text, TouchableOpacity, View} from 'react-native';
import styled from 'styled-components/native';
import { Ionicons } from '@expo/vector-icons';

//Settings text
const Container = styled.View`
  flex: 1;
  background-color: #fff;
  align-items: center;
  justify-content: center;
`;

//Back Button
const Back = styled.TouchableOpacity`
  background-color: #fff;
  flex-direction: row;
  align-items: center;
  border: solid 3px blue;
  border-radius: 8px;
  padding: 4px 20px;
  justify-content: center;
`;


// Dark Mode button
const Dark = styled.TouchableOpacity`
  background-color: #fff;
  flex-direction: row;
  align-items: center;
  border: solid 3px blue;
  border-radius: 8px;
  padding: 4px 20px;
  justify-content: center;
`;

// Notifcations Button
const Noti = styled.TouchableOpacity`
  background-color: #fff;
  flex-direction: row;
  align-items: center;
  border: solid 3px blue;
  border-radius: 8px;
  padding: 4px 20px;
  justify-content: center;
`;

//Interests buttons 
const Inter = styled.TouchableOpacity`
  background-color: #fff;
  flex-direction: row;
  align-items: center;
  border: solid 3px blue;
  border-radius: 8px;
  padding: 4px 20px;
  justify-content: center;
`;


export default function Settings(){
    return(
        <Container>
        <Text>Settings</Text>

        <Dark><Ionicons name="md-moon" size={32} color="black" /><Text>Dark Mode</Text></Dark>
        <Noti><Ionicons name="ios-notifications" size={32} color="black" /><Text>Notifications</Text></Noti>
        <Inter><Ionicons name="staro" size={32} color="black" /><Text>Notifications</Text></Inter>
        <Back><Ionicons name="md-arrow-round-back" size={32} color="black" /><Text>Notifications</Text></Back>

        </Container> 
        );


}
